function alertaClick(){
  alert("Funciona el boton");
 }    
 const imagenes = ["carrusel1.png", "carrusel2.png", "carrusel3.png"];
 let contador = 0;

      function cambioImagen() {
          contador = (contador + 1) % imagenes.length;
          actualizarImagen();
      }
      function cambioImagenAtras() {
          contador = (contador - 1 + imagenes.length) % imagenes.length; // Evita valores negativos
          actualizarImagen();
      }
      function actualizarImagen() {
          const imagenActiva = document.getElementById("carrusel");
          if (imagenActiva) {
              imagenActiva.setAttribute("href", imagenes[contador]);
          } else {
              console.error("No se encontró el elemento");
          }
      }
